<h4>药品</h4>
<ul>
<li><strong>传统与现代</strong>: 传统药物源自自然，如古柯叶中的可卡因、罂粟中的鸦片，而现代技术将其浓缩，提高了快感和多巴胺释放，但也增加了成瘾风险。</li>
<li><strong>滥用问题</strong>: 美国阿片类药物滥用严重，中东地区出现药物滥用，如芬乃他林（Captagon）。</li>
